import React from "react";
import Commonhead from "./Commonhead";
import Img from "../src/images/header.svg";
const Home = () =>{
    return(
        <>
          <Commonhead name="Grow your business with" imgsrc={Img} link="/contact" btn_name="Contact Now" />  
        </>
    )
}

export default Home;
